    static class Solution {
        Solution(){}
        public void mapAdd(String string,HashMap<String,Integer> map){
            if(!map.containsKey(string))
                map.put(string,1);
            else
                map.put(string,map.get(string)+1);
        }

        public void changeString(String string, HashMap<String,Integer> map){
            mapAdd(string,map);

            StringBuilder sb=new StringBuilder(string.length());
            String string2="";
            sb.append(string.charAt(1));
            sb.append(string.charAt(0));
            sb.append(string.charAt(2));

            if(!string.equals(sb.toString())){
                string2=sb.toString();
                mapAdd(string2,map);
            }


            sb.delete(0,3);

            sb.append(string.charAt(0));
            sb.append(string.charAt(2));
            sb.append(string.charAt(1));
            if(!string.equals(sb.toString())&&!string2.equals(sb.toString())){
                mapAdd(sb.toString(),map);
            }
        }
        public int solution(String[] T) {
            // write your code in Java SE 8
            HashMap<String,Integer> map=new HashMap<>();

            //origin
            for (String s:T) {
                changeString(s,map);
            }

            int max=0;
            for (String s:map.keySet()) {
                if(map.get(s)>max)
                    max=map.get(s);
            }
            return  max;

        }
    }
